import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route,Switch } from 'react-router-dom';
import './index.css';
import App from './App';

function Home()
{
return(
<Switch>
      <Route path="/" component={App}></Route>
  </Switch>
)
}
ReactDOM.render(
  <BrowserRouter>
  <Home/>
  </BrowserRouter>,
  document.getElementById('root')
);
